import React from "react";
// import "./styles.css";
import { Tabs, Tab, AppBar } from "@material-ui/core";
import { Route, BrowserRouter, Switch, Link } from "react-router-dom";
import Tab1 from "./views/Tab1";
import Tab2 from "./views/Tab2";

export default function App() {
  const routes = ["/tab1", "/tab2"];
  return (
    <div className="App">
      <BrowserRouter>
        <Route
          path="/"
          render={(history) => (
            <AppBar>
              <Tabs
                value={
                  history.location.pathname !== "/"
                    ? history.location.pathname
                    : false
                }
              >
                {console.log(history.location.pathname)}
                <Tab
                  value={routes[0]}
                  label="Tab1"
                  component={Link}
                  to={routes[0]}
                />
                <Tab
                  value={routes[1]}
                  label="Tab2"
                  component={Link}
                  to={routes[1]}
                />
              </Tabs>
            </AppBar>
          )}
        />

        <Switch>
          <Route path="/books" component={Tab1} />
          <Route path="/favorites" component={Tab2} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}
